import React from 'react';
import './AboutProject.css';

function AboutProject() {
    return (
        <div className="about-project">
            <h2 id="#point1" className="about-project__title">О проекте</h2>
            <div className="about-project__content-header">
                <h3 className="about-project__content-head">Дипломный проект включал 5 этапов</h3>
                <h3 className="about-project__content-head">На выполнение диплома ушло 5 недель</h3>
            </div>
            <div className="about-project__content">
                <p className="about-project__paragraph">Составление плана, работу над бэкендом, вёрстку, добавление функциональности и финальные доработки.</p>
                <p className="about-project__paragraph">У каждого этапа был мягкий и жёсткий дедлайн, которые нужно было соблюдать, чтобы успешно защититься.</p>
            </div>
            <div className="about-project__infografic">
                <div className="about-project__infografic-backend">1 неделя</div>
                <div className="about-project__infografic-frontend">4 недели</div>
            </div>
        </div>
    )
}

export default AboutProject;
